or medium sized families. Energy rating: 4 star, Annual energy consumption: 128 KW. (Please refer energy label on product page or contact brand for more details). Warranty: 1 year warranty on comprehensive ;5 years warranty on compressor. Compressor: The refrigerator comes with reciprocatory compressor that is ideal for optimum cooling. The Refrigerator comes with PUF insulation that helps retain low temperatures efficiently for better cooling. Shelf type: Spill proof toughened glass. Inside box: 1 unit Refrigerator & 1 Unit user manual, Ice tray and warranty card. Special Features: This Refrigerator comes with 1 HIT, Stabilizer free operation, Defrost button, large vegetable box and toughened glass shelves',13353,'https://images-na.ssl-images-amazon.com/images/I/713F6Ao62WL._SL1500_.jpg',34,86,6,1),('P-100558476','Oppo A52 (Twilight Black, 6GB RAM, 128GB Storage) with No Cost EMI/Additional Exchange Offers','12MP+8MP+2MP+2MP AI quad rear camera, 4K video, AI beautification | 16MP front camera. 16.51 centimeters (6.5-inch) FHD+ punch-hole display with 2400 x 1080 pixels resolution, 405 ppi pixel density | 90.5% screen to body ratio| Eye care. Memory, Storage & SIM: 6GB RAM | 128GB internal memory expandable up to 256GB | Dual SIM (nano+nano) dual-standby (4G+4G). Color OS 7.1 based on Android v10.0 operating system with 2.0GHz Qualcomm Snapdragon 665 octa core processor, Adreno 610 GPU. 5000mAH lithium-polymer battery providing talk-time of 34 hours and standby time of 500 hours with 18W fast charge. 1 year manufacturer warranty for device and 6 months manufacturer warranty for in-box accessories including batteries from the date of purchase. Box also includes: Handset, type-c cable, earphone, adapter, Sim Tray Ejector, protective case, booklet with warranty card and quick guide. Great audio effect: Dual stereo speakers, dirac 2.0',13853,'https://images-na.ssl-images-amazon.com/images/I/71FPmXaDfbL._SL1500_.jpg',1026,41,1,1),('P-100574451','NikonDigital Camera Z 5 Body','Nikon Z mount. Sensor Size: 35.9 mm x 23.9 mm. Z mount NIKKOR lenses F mount NIKKOR lenses (mount adapter required; restrictions may apply). FOCUS ON CREATING. EXPAND YOUR FULL POTENTIAL. CAPTURING POSSIBILITIES. EFFORTLESS CONTROL. GO BEYOND',94873,'https://images-na.ssl-images-amazon.com/images/I/91uPCnMOh4L._SL1500_.jpg',10,39,5,1),('P-100620817','CP PLUS IP 2MP CCTV Camera Combo KIT 16CH NVR 11 Bullet Camera 5 Dome Camera 2TB Hard Disk (Installation is NOT Included) A Complete Combo by Techno-Kam Company','Cp Plus 2mp IP bullet camera 11pcs.. Cp Plus 2mp IP Dome camera 5pcs.. CP plus 2mp 16ch NVR for 16 camera 1pcs.. Hard Disk 2TB 1Pcs.. Company can change their model number and product look without giving any notice so maybe if the model number and product look is changed you will receive upgraded model but the products specifications are same or updated # Installation is not included.',71859,'https://images-na.ssl-images-amazon.com/images/I/617Xc3oM5ML._SL1000_.jpg',10,70,5,1),('P-100680985','LG 8.0 Kg 5 Star Inverter Fully-Automatic Front Loading Washing Machine (FHM1208ZDL, Luxury Silver, Direct Drive Technology)','Fully-automatic front load washing machine: best wash quality, energy and water efficient. Energy Rating 5 Star: best in class efficiency. Capacity 8.0 kg: Suitable for bachelors & couples. Warranty: 2 years on product, 10 years on motor (T&C). 1200 RPM: higher spin speeds helps in faster drying. 10 washing programs. Special features: inverter direct drive motor, fast & Clean wash with 6 Motions, child lock, time delay, crome on door, Jog dial for programs selection, smart diagnosis,Baby Care. Included Components : 1 unit of machine, 1 unit of drain hose, 1 unit OT hose, 1 unit of QRG, 1 unit of user manual',31841,'https://images-na.ssl-images-amazon.com/images/I/81e%2BAYbDELL._SL1500_.jpg',513,72,7,1),('P-100821007','Whirlpool 7.5 Kg 5 Star Semi-Automatic Top Loading Washing Machine (ACE 7.5 SUPREME, Grey Dazzle)','Ace wash station - Now sort, stack and carry your clothes on the machine itself. In-Built Scrubber: Added in the Wash tub to give Clothes the perfect wash. No of Wash Programs - 3 ( Delicate, Normal and Heavy). SUPERSOAK TECHNOLOGY - Easy removal of tough dirt by continuous soaking and scrubbing action for 25 minutes. EASY MOBILITY - Equipped with 4 wheels, the machine can be moved around by sliding it with ease.. Maximum spin speed of 1400 RPM for superior drying of clothes. Autorestart, End of cycle buzzer',9858,'https://images-na.ssl-images-amazon.com/images/I/61WJqbSrQQL._SL1500_.jpg',64,84,7,1),('P-100862029','Whirlpool 215 L 5 Star Inverter Direct-Cool Single Door Refrigerator (230 IMPRO PRM 5S INV ALPHA STEEL, Alpha Steel)','Direct-cool refrigerator; 215 litres capacity. Energy Rating: 5 Star. Warranty: 1 year on product, 10 years on compressor. New crescent door Design. Intellisense inverter technology. Up to 7 days of Garden freshness. Up to 12 hours of milk preservation during power cuts',17673,'https://images-na.ssl-images-amazon.com/images/I/719i08lbYxL._SL1500_.jpg',12,88,6,1),('P-100897710','Noise Tune Charge Bluetooth Wireless Neckband Earphones with Bass Booster Button for Deep Bass and Stunning Audio Clarity, Ultra-Long Playback up to 16 Hours, IPX5 Sweat Proof (Jet Black)','Turn on the bass: Enjoy thumping bass on Tune Charge with the press of dedicated bass booster button. 16 Hour Playtime: Tune Charge comes with an ultralong playback time of 16 hours.. Inline remote control: Now you can playback, adjust volume and manage calls and more without even taking out the earphones, courtesy inline buttons on the earphones. IPX5 Sweat Proof: Tune Charge can now charge you through your most strenuous workouts, all thanks to the IPX5 sweatproof rating. Stunning Sound Experience: Get ready for astounding audio clarity with Qualcomm 3003 Chipset in Tune Charge. Dual Pairing Mode: Tune Charge pairs and connects with two Bluetooth devices simultaneously. Magnetic Earbuds: Keep your earbuds in place with the magnetic earbuds that snap together when not plugged in. Voice assistant: Activate Siri/Google Assistant at the tap of a button and get the assistants to do your job. Bluetooth v5.0: Tune Charge is compatible with Bluetooth Devices equipped with version 5 and enjoys a stable connection for up to 10 meters of range. Bluetooth Supported Profile HFP V1.7;HSP V1.2;A2DP V1.3.1;AVRCP V1.6',1382,'https://images-na.ssl-images-amazon.com/images/I/61DGRnhbpfL._SL1500_.jpg',2911,41,4,1),('P-100901570','boAt Bassheads 102 in Ear Wired Earphones with Mic(Fiery Red)','Has a durable PVC Cable which is tangle free. Compatibility and Connectivity: Compatible with Android/iOS and connectivity via 3.5mm AUX cable. IPX Rating: NA. Active Noise Cancellation: NA. Mic: In line Mic. Other Inclusions: Additional earbuds, Warranty Card. 1 year warranty from the date of purchase, you can activate your warranty by giving a missed call on 9223032222. Alternatively you can claim your warranty at support.boat-lifestyle.com or reach out to us at +912249461882/info@imaginemarketingindia.com.',326,'https://images-na.ssl-images-amazon.com/images/I/61tdW6bS2zL._SL1500_.jpg',7812,70,4,1),('P-100912251','Nikon Z6 Mirrorless Camera Body Only','Single frame, low-speed continuous, high-speed continuous, high-speed continuous (extended), self-timer. Electronically-controlled vertical-travel focal-plane mechanical shutter; electronic front-curtain shutter; electronic shutter. Automatically switches between monitor and viewfinder displays. Up to 9 fps Low-speed continuous: 1 to 5 fps High-speed continuous: 5.5 fps (14-bit NEF/RAW: 5 fps) High-speed continuous (extended): 9 fps (14-bit NEF/RAW: 8 fps). Auto; programmed auto with flexible program (P); shutter-priority auto (S); aperture-priority auto (A); manual (M); user settings (U1, U2, U3). Can be selected from Auto, Extra high, High, Normal, Low, or Off',124859,'https://images-na.ssl-images-amazon.com/images/I/51DYjGe8XZL._SL1000_.jp